            "created": 1457709309000, 
            "description": "<p>NoVA\u00a0Elixir\u00a0meetup has graciously offered GDI members\u00a0scholarships for Elixir Mastery three times around. The first two times they were full scholarships but because we've had a no show it is now a partial scholarship. Please only RSVP if you're certain you will be able to make all three days of the series (4/27, 4/28 and 4/29; 830a-5p).\u00a0\u00a0</p> <p>\n\n\n<b>About the Scholarship</b></p> <p>The class cost is $1500/pp for three days, but Elixir Mastery is offering GDI DC three tickets at a reduced rate of $75! If you are certain you will be able to make all three days, <a href=\"https://ti.to/elixir-mastery/spring-2016/with/jkkizqyn-3a\">RSVP here</a>. Again, please ONLY RSVP IF YOU'RE ABSOLUTELY SURE YOU CAN MAKE IT. After three people have entered the code others can no longer claim it.\u00a0</p> <p>\n\n\n<b>About Elixir\u00a0</b></p> <p>Elixir is a programming language that feels a lot like Ruby, but runs on the Erlang virtual machine, which means that it is excellent for building concurrent and distributed applications.\u00a0</p> <p>\n\n\n<b>About the Course</b></p> <p>This course covers\u00a0<a href=\"http://elixir-lang.org/\">Elixir</a>\u00a0as a language along with its tooling system. On the second day you'll cover\u00a0<a href=\"http://elixir-lang.org/getting-started/processes.html\">Processes</a>, along with slicing and dicing\u00a0<a href=\"http://elixir-lang.org/getting-started/binaries-strings-and-char-lists.html#binaries-%28and-bitstrings%29\">Binary Data</a>\u00a0and\u00a0<a href=\"http://learnyousomeerlang.com/what-is-otp\">OTP</a>. The third day will be dedicated to\u00a0<a href=\"http://www.phoenixframework.org/\">Phoenix</a>.\u00a0</p> <p>\n\n\nMore information can be found on the\u00a0<a href=\"http://www.elixirmastery.com/\">Elixir Mastery website</a>.\u00a0</p> <p>\n\n\n<b>Other</b></p> <p>Please note you are\u00a0NOT\u00a0registered for this event by RSVPing on this meetup. Please make sure you <a href=\"https://ti.to/elixir-mastery/spring-2016/with/jkkizqyn-3a\">register here</a>. We have scholarships for the first three members that RSVP, making the course $75.\u00a0Please only RSVP if you're certain you will be able to make it.\u00a0</p>", 
