            "created": 1459703387000, 
            "description": "<p>Early Bird registration on\u00a0<a href=\"http://wcm-iterate.eventbrite.com\">Eventbrite</a>\u00a0through Friday, 4/15.</p> <p><br/><b>OVERVIEW</b></p> <p>Stop doing website redesigns!\u00a0</p> <p>Join the Web Content Mavens and learn how to to make incremental and iterative changes to your site instead.</p> <p>The event will cover 3 main points:</p> <p>\u00a0 * The benefits of making interative changes.</p> <p>\u00a0 * How to set up an iterative process in your organization including methods for identifying, managing and testing site updates.</p> <p>\u00a0 * How to apply this model to immediate issues as well as larger, structural changes to your website.</p> <p><b>AGENDA</b></p> <p>We will begin at 6:30 with light appetizers and drinks, followed by presentations at 7:00. After Q&amp;A, we will have another 20 minutes of networking.</p> <p><b>SPEAKERS</b></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/5/8/2/b/600_448762571.jpeg\" /></p> <p><b>Tim Maxey</b>,\u00a0Senior Director of IT at\u00a0ARVO (Association for Research in Vision and Ophthalmology)</p> <p>Tim Maxey is the Sr. Director of Information Technology for the Association for Research in Vision and Ophthalmology. With over 20 years working in the not-for-profit industry, his expertise spans a broad range of technologies including infrastructure, security, web presence, project management, database management, application development, and financial management for multiple associations.</p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/5/8/7/3/600_448762643.jpeg\" /></p> <p><b>Frank Klassen</b>, CEO at Brightfind\u00a0</p> <p>Frank is the CEO of Brightfind, where he is responsible for executing on the vision of the company \u2013 to be a nationally recognized creator of digital experiences that deliver provable value to our clients\u2019 customers. Prior to Brightfind, Frank was the VP of Web Technology for Syscom Services. He has more than three decades of experience in the implementation of information system technologies in a wide variety of business environments, for both private and public sector companies. For the last 20 years, Frank has been focused on helping organizations utilize the web to address critical business processes and increase customer engagement.\u00a0 His current passions are in the areas of Taxonomy, Search, Findability, and Web User Experience Design.</p> <p><b>OUR SPONSOR</b></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/5/9/d/a/600_448763002.jpeg\" /></p> <p>Brightfind (<a href=\"http://www.brightfind.com/\">www.brightfind.com</a>) is a specialized digital design and web development agency. We create outstanding experiences for organizations with deep, complex content.\u00a0Every experience we create is designed to address unique audiences, achieve specific goals, and engage visitors through personalization. Our clients enjoy the freedom of informed decision making.</p> <p>We\u2019re hiring User Experience Designers, Project Managers, Front-end and Back-end Developers. Visit our\u00a0<a href=\"http://bit.ly/1Kg4bMO\">Careers page</a>\u00a0to view open positions and apply.</p>", 
